This is an attribute that indicates that the test can work offline. It can receive an optional argument, to control this behavior. #[upsilon_test] // will run in offline mode (default)
async fn t1(cx: &mut TestCx) -> TestResult { // ... Ok(())
} #[upsilon_test]
#[offline] // will run in offline mode (explicit)
async fn t2(cx: &mut TestCx) -> TestResult { // ... Ok(())
} #[upsilon_test]
#[offline(run)] // will run in offline mode (explicit)
async fn t3(cx: &mut TestCx) -> TestResult { // ... Ok(())
} #[upsilon_test]
#[offline(ignore)] // will not run in offline mode (ignored)
async fn t4(cx: &mut TestCx) -> TestResult { // ... Ok(())
} Tests that actually require to connect to some other server (over an internet connection) should use #[offline(ignore)] to make sure they are online when running.
